import { createContext, useState } from "react"

export const FormContext = createContext()

export const FormContextProvider = ({ children }) => {

    const [showForm, setShowForm] = useState(true)

    return (
        <FormContext.Provider
            value={showForm}
        >
            {children}
        </FormContext.Provider>
    );
};
